import React from 'react';
import { motion } from 'framer-motion';
import { useTheme } from '../App';
import { Brain, Twitter, Linkedin, Github, Mail } from 'lucide-react';

const Footer = () => {
  const { colors } = useTheme();

  const footerStyles = {
    footer: {
      background: colors.surface,
      borderTop: `1px solid ${colors.border}`,
      marginTop: '4rem',
    },
    container: {
      maxWidth: '1400px',
      margin: '0 auto',
      padding: '4rem 2rem 2rem 2rem',
    },
    grid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(1, 1fr)',
      gap: '3rem',
      marginBottom: '3rem',
    },
    brand: {
      marginBottom: '2rem',
    },
    logo: {
      display: 'flex',
      alignItems: 'center',
      gap: '0.75rem',
      textDecoration: 'none',
      marginBottom: '1rem',
    },
    logoText: {
      fontSize: '1.5rem',
      fontWeight: 'bold',
      background: colors.gradient,
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      backgroundClip: 'text',
    },
    description: {
      color: colors.textSecondary,
      lineHeight: 1.6,
      maxWidth: '400px',
    },
    section: {
      marginBottom: '2rem',
    },
    sectionTitle: {
      color: colors.text,
      fontSize: '1.125rem',
      fontWeight: '600',
      marginBottom: '1rem',
    },
    linkList: {
      listStyle: 'none',
    },
    link: {
      color: colors.textSecondary,
      textDecoration: 'none',
      transition: 'color 0.3s ease',
      display: 'block',
      marginBottom: '0.5rem',
    },
    socialLinks: {
      display: 'flex',
      gap: '1rem',
      marginTop: '1rem',
    },
    socialLink: {
      color: colors.textSecondary,
      transition: 'all 0.3s ease',
    },
    bottom: {
      borderTop: `1px solid ${colors.border}`,
      paddingTop: '2rem',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      gap: '1rem',
      textAlign: 'center',
    },
    copyright: {
      color: colors.textSecondary,
      fontSize: '0.875rem',
    },
  };

  const productLinks = [
    'Content Generation',
    'Multi-language Support',
    'Blockchain Verification',
    'Analytics Dashboard',
    'API Access'
  ];

  const companyLinks = [
    'About VeriCreate',
    'Enterprise Solutions',
    'Case Studies',
    'Press Kit',
    'Careers'
  ];

  const resourceLinks = [
    'Documentation',
    'Help Center',
    'Content Guidelines',
    'Community Forum',
    'Status Page'
  ];

  const socialLinks = [
    { icon: Twitter, url: '#', label: 'Twitter' },
    { icon: Linkedin, url: '#', label: 'LinkedIn' },
    { icon: Github, url: '#', label: 'GitHub' },
    { icon: Mail, url: '#', label: 'Email' },
  ];

  return (
    <motion.footer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ delay: 0.5 }}
      style={footerStyles.footer}
    >
      <div style={footerStyles.container}>
        <div style={footerStyles.grid}>
          {/* Brand Section */}
          <div style={footerStyles.brand}>
            <div style={footerStyles.logo}>
              <Brain size={28} style={{ color: colors.primary }} />
              <span style={footerStyles.logoText}>VeriCreate</span>
            </div>
            <p style={footerStyles.description}>
              Transforming content production for media, education, and advertising 
              with AI-powered automation and blockchain verification.
            </p>
            <div style={footerStyles.socialLinks}>
              {socialLinks.map((social, index) => (
                <motion.a
                  key={index}
                  href={social.url}
                  whileHover={{ scale: 1.2, y: -2, color: colors.primary }}
                  style={footerStyles.socialLink}
                >
                  <social.icon size={20} />
                </motion.a>
              ))}
            </div>
          </div>

          {/* Product Links */}
          <div style={footerStyles.section}>
            <h3 style={footerStyles.sectionTitle}>Product</h3>
            <ul style={footerStyles.linkList}>
              {productLinks.map((link, index) => (
                <li key={index}>
                  <a href="#" style={footerStyles.link}>{link}</a>
                </li>
              ))}
            </ul>
          </div>

          {/* Company Links */}
          <div style={footerStyles.section}>
            <h3 style={footerStyles.sectionTitle}>Company</h3>
            <ul style={footerStyles.linkList}>
              {companyLinks.map((link, index) => (
                <li key={index}>
                  <a href="#" style={footerStyles.link}>{link}</a>
                </li>
              ))}
            </ul>
          </div>

          {/* Resources Links */}
          <div style={footerStyles.section}>
            <h3 style={footerStyles.sectionTitle}>Resources</h3>
            <ul style={footerStyles.linkList}>
              {resourceLinks.map((link, index) => (
                <li key={index}>
                  <a href="#" style={footerStyles.link}>{link}</a>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Bottom Section */}
        <div style={footerStyles.bottom}>
          <p style={footerStyles.copyright}>
            Â© 2024 VeriCreate AI. All rights reserved. 
            Transforming content production for enterprises worldwide.
          </p>
        </div>
      </div>
    </motion.footer>
  );
};

export default Footer;
